    <Table>
      <thead>
      <tr>
        <th>Vorname</th>
        <th>Nachname</th>
        <th>Beschreibung</th>
        <th>ErstellungsDatum</th>
        <th>Action</th>
      </tr>
      </thead>
      <tbody>
      {rows}
      </tbody>
    </Table>
  );
}

export default List;
